// Lexical Scanner using RawToken and StrTokenizer
pub struct c11manualmllexer<'lt> {
   stk: StrTokenizer<'lt>,
   keywords: HashSet<&'static str>,
   lexnames: HashMap<&'static str,&'static str>,
   shared_state: Rc<RefCell<HashSet<&'lt str>>>,
}
impl<'lt> c11manualmllexer<'lt> 
{
  pub fn from_str(s:&'lt str) -> c11manualmllexer<'lt>  {
    Self::new(StrTokenizer::from_str(s))
  }
  pub fn from_source(s:&'lt LexSource<'lt>) -> c11manualmllexer<'lt>  {
    Self::new(StrTokenizer::from_source(s))
  }
  pub fn new(mut stk:StrTokenizer<'lt>) -> c11manualmllexer<'lt> {
    let mut lexnames = HashMap::with_capacity(64);
    let mut keywords = HashSet::with_capacity(64);
    let shared_state = Rc::new(RefCell::new(<HashSet<&'lt str>>::default()));
    for kw in ["long","sizeof","_Generic","volatile","case","short","switch","continue","_Noreturn","for","__func__","default","auto","_Imaginary","struct","restrict","const","_Alignof","void","if","char","register","double","_Alignas","goto","signed","_Atomic","return","float","_Thread_local","do","extern","enum","typedef","while","_Static_assert","break","unsigned","static","_Complex","inline","int","else","union","_WILDCARD_TOKEN_","_Bool",] {keywords.insert(kw);}
    for c in ['[',']','(',')','+','-','~',';','>','%','=','^','<','{','}','?',':','/','!','*','.','&','|',',',] {stk.add_single(c);}
    for d in ["<=","||",">=","+=","%=",">>","|=","==","-=","!=","->","^=","/=","&&","--","&=","*=","++","<<",] {stk.add_double(d);}
    for d in ["<<=",">>=","...",] {stk.add_triple(d);}
    for (k,v) in [(r"float","FLOAT"),(r"register","REGISTER"),(r">","Gt"),(r"__func__","FUNC_NAME"),(r"static","STATIC"),(r"_Alignas","ALIGNAS"),(r"case","CASE"),(r"while","WHILE"),(r"%","Percent"),(r"=","ASSIGN"),(r"_Complex","COMPLEX"),(r"<=","LE_OP"),(r"<<=","LEFT_ASSIGN"),(r"return","RETURN"),(r"auto","AUTO"),(r"^","Hat"),(r"||","OR_OP"),(r"_Thread_local","THREAD_LOCAL"),(r"struct","STRUCT"),(r"for","FOR"),(r"break","BREAK"),(r"<","Lt"),(r">=","GE_OP"),(r"extern","EXTERN"),(r"goto","GOTO"),(r"_Atomic","ATOMIC"),(r"_Imaginary","IMAGINARY"),(r"int","INT"),(r"inline","INLINE"),(r"+=","ADD_ASSIGN"),(r"{","Lbrace"),(r"%=","MOD_ASSIGN"),(r"}","Rbrace"),(r"switch","SWITCH"),(r"?","Quest"),(r">>","RIGHT_OP"),(r"|=","OR_ASSIGN"),(r">>=","RIGHT_ASSIGN"),(r"==","EQ_OP"),(r"-=","SUB_ASSIGN"),(r"!=","NE_OP"),(r"->","PTR_OP"),(r"^=","XOR_ASSIGN"),(r"typedef","TYPEDEF"),(r"double","DOUBLE"),(r"else","ELSE"),(r"/=","DIV_ASSIGN"),(r"_Noreturn","NORETURN"),(r"&&","AND_OP"),(r":","Colon"),(r"volatile","VOLATILE"),(r"_Generic","GENERIC"),(r"--","DEC_OP"),(r"/","Div"),(r"unsigned","UNSIGNED"),(r"&=","AND_ASSIGN"),(r"!","Bang"),(r"if","IF"),(r"_Alignof","ALIGNOF"),(r"*=","MUL_ASSIGN"),(r"sizeof","SIZEOF"),(r"...","ELLIPSIS"),(r"do","DO"),(r"++","INC_OP"),(r"const","CONST"),(r"union","UNION"),(r"*","Star"),(r"default","DEFAULT"),(r"restrict","RESTRICT"),(r".","Dot"),(r"_Static_assert","STATIC_ASSERT"),(r"long","LONG"),(r"signed","SIGNED"),(r"short","SHORT"),(r"void","VOID"),(r"continue","CONTINUE"),(r"_Bool","BOOL"),(r"<<","LEFT_OP"),(r"char","CHAR"),(r"&","Amp"),(r"|","Bar"),(r",","Comma"),(r"enum","ENUM"),] {lexnames.insert(k,v);}
    stk.add_custom("directive",r"^(?m)^#.*$");
    c11manualmllexer {stk,keywords,lexnames,shared_state}
  }
}
impl<'lt> Tokenizer<'lt,RetTypeEnum<'lt>> for c11manualmllexer<'lt>
{
   fn nextsym(&mut self) -> Option<TerminalToken<'lt,RetTypeEnum<'lt>>> {
    let tokopt = self.stk.next_token();
    if let None = tokopt {return None;}
    let token = tokopt.unwrap();
    match token.0 {
      RawToken::Alphanum(sym) if self.keywords.contains(sym) => {
        let truesym = self.lexnames.get(sym).unwrap_or(&sym);
        Some(TerminalToken::from_raw(token,truesym,<RetTypeEnum<'lt>>::default()))
      },
      RawToken:: Alphanum(n) if self.shared_state.borrow().contains(n) => Some(TerminalToken::from_raw(token,"TYPEDEF_NAME",RetTypeEnum::Enumvariant_9( n
))),
      RawToken:: Alphanum(n) => Some(TerminalToken::from_raw(token,"IDENTIFIER",RetTypeEnum::Enumvariant_9( n
))),
      RawToken:: Alphanum(n) => Some(TerminalToken::from_raw(token,"ENUMERATION_CONSTANT",RetTypeEnum::Enumvariant_9( n
))),
      RawToken:: Num(n) => Some(TerminalToken::from_raw(token,"I_CONSTANT",RetTypeEnum::Enumvariant_6( (n as i32)
))),
      RawToken:: Float(n) => Some(TerminalToken::from_raw(token,"F_CONSTANT",RetTypeEnum::Enumvariant_7( n
))),
      RawToken:: Strlit(s) => Some(TerminalToken::from_raw(token,"STRING_LITERAL",RetTypeEnum::Enumvariant_9( s
))),
      RawToken:: Custom("directive",d) => Some(TerminalToken::from_raw(token,"COMPILER_DIRECTIVE",RetTypeEnum::Enumvariant_9( d
))),
      RawToken::Symbol(s) if self.lexnames.contains_key(s) => {
        let tname = self.lexnames.get(s).unwrap();
        Some(TerminalToken::from_raw(token,tname,<RetTypeEnum<'lt>>::default()))
      },
      RawToken::Symbol(s) => Some(TerminalToken::from_raw(token,s,<RetTypeEnum<'lt>>::default())),
      RawToken::Alphanum(s) => Some(TerminalToken::from_raw(token,s,<RetTypeEnum<'lt>>::default())),
      _ => Some(TerminalToken::from_raw(token,"<LexicalError>",<RetTypeEnum<'lt>>::default())),
    }
  }
   fn linenum(&self) -> usize {self.stk.line()}
   fn column(&self) -> usize {self.stk.column()}
   fn position(&self) -> usize {self.stk.current_position()}
   fn current_line(&self) -> &str {self.stk.current_line()}
   fn get_line(&self,i:usize) -> Option<&str> {self.stk.get_line(i)}
   fn get_slice(&self,s:usize,l:usize) -> &str {self.stk.get_slice(s,l)}
   fn transform_wildcard(&self,t:TerminalToken<'lt,RetTypeEnum<'lt>>) -> TerminalToken<'lt,RetTypeEnum<'lt>> { TerminalToken::new(t.sym,RetTypeEnum::Enumvariant_2((self.stk.previous_position(),self.stk.current_position())),t.line,t.column) }
}//impl Tokenizer

